import React from 'react';
import {
  Box, Typography, Grid, Paper, Table, TableBody,
  TableCell, TableContainer, TableHead, TableRow, Button
} from '@mui/material';

const ReviewerReport = ({ formData, onBack, onPrint }) => {
  return (
    <Box sx={{ p: 4 }}>
      <Typography variant="h4" align="center" gutterBottom sx={{ mb: 4 }}>
        APPLICATION FORM REPORT - Bachelor of Physiotherapy - 2025
      </Typography>

      {/* Applicant Details Section */}
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>Applicant's Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><Typography><strong>Name:</strong> {formData.name}</Typography></Grid>
              <Grid item xs={6}><Typography><strong>Father's Name:</strong> {formData.fatherName}</Typography></Grid>
              {/* Add all other fields similarly */}
            </Grid>
          </Paper>
        </Grid>

        {/* Action Buttons */}
        <Grid item xs={12} sx={{ mt: 4, display: 'flex', justifyContent: 'space-between' }}>
          <Button 
            variant="contained" 
            color="secondary"
            onClick={onBack}
            sx={{ mr: 2 }}
          >
            Back to Form
          </Button>
          <Button 
            variant="contained" 
            color="primary"
            onClick={onPrint}
          >
            Print Report
          </Button>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ReviewerReport;
